filepath: ""
environments:
  default:
    values:
    - jx-values.yaml
repositories:
- name: jxgh
  url: https://jenkins-x-charts.github.io/repo
- name: dev
  url: https://chartmuseum.pluto.binomy.io
releases:
- chart: jxgh/jx-verify
  name: jx-verify
  namespace: jx-production
  values:
  - jx-values.yaml
- chart: dev/origins-cms
  version: 0.0.20
  name: origins-cms
  namespace: jx-production
  values:
  - jx-values.yaml
- chart: jxgh/acme
  version: 0.0.24
  condition: jxRequirementsIngressTLS.enabled
  name: acme-jx
  namespace: jx-production
  values:
  - jx-values.yaml
  - acme-values.yaml
  - ../../versionStream/charts/jxgh/acme-jx/values.yaml.gotmpl
- chart: dev/stocks-ui
  version: 0.0.7
  name: stocks-ui
  namespace: jx-production
  values:
  - jx-values.yaml
templates: {}
renderedvalues: {}
